import "../Styles/Store.scss"

export default function Store(){

  const [state, dispatch] = useReducer(loginReducer, initialState);
  const { todos, isLoggedIn } = state;
  return (
    <div className="Store">
      <TodoPage todos={todos} dispatch={dispatch} isLoggedIn={isLoggedIn} />
    </div>



    )
};
